//SPDX-License-Identifier: MIT
pragma solidity 0.8.15;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";
import "./interfaces/IRouter.sol";
import "./interfaces/ISnacks.sol";

/// @title Contract that distributes currencies
contract Seniorage is Ownable, Initializable {
    using SafeERC20 for IERC20;
    using EnumerableSet for EnumerableSet.AddressSet;
    
    uint256 constant private BASE_PERCENT = 10000;
    uint256 constant private FIVE_PERCENT = 500;
    uint256 constant private SEVEN_AND_A_HALF_PERCENT = 750;
    uint256 constant private TEN_PERCENT = 1000;
    uint256 constant private FIFTEEN_PERCENT = 1500;
    uint256 constant private TWENTY_PERCENT = 2000;
    uint256 constant private TWENTY_FIVE_PERCENT = 2500;
    uint256 constant private THIRTY_FIVE_PERCENT = 3500;
    uint256 constant private SEVENTY_FIVE_PERCENT = 7500;
    uint256 constant private SLIPPAGE_PERCENT = 9500;
    uint256 constant private SENIORAGE_PERCENT = 6667;
    uint256 constant private PULSE_PERCENT = 3333;
    
    address private BUSD;
    address private CAKELP;
    address private BTC;
    address private ETH;
    address private ZOINKS;
    address private SNACKS;
    address private BTCSNACKS;
    address private ETHSNACKS;
    address private bdmWallet;
    address private crmWallet;
    address private devManagerWallet;
    address private marketingManagerWallet;
    address private devWallet;
    address private marketingFundWallet;
    address private reservesWallet;
    address private situationalFundWallet;
    address private seniorageWallet;
    address private distributor;
    address private pulse;
    address private router;
    
    EnumerableSet.AddressSet private nonBUSDcurrencies;
    
    modifier onlyDistributor {
        require(
            msg.sender == distributor,
            "Seniorage: caller is not the distributor"
        );
        _;
    }
    
    constructor(
        address _BUSD,
        address _CAKELP,
        address _BTC,
        address _ETH,
        address _ZOINKS,
        address _SNACKS,
        address _BTCSNACKS,
        address _ETHSNACKS,
        address _distributor,
        address _pulse,
        address _router
    )
    {
        require(
            _BUSD != address(0) &&
            _distributor != address(0) &&
            _pulse != address(0) &&
            _router != address(0),
            "Seniorage: one of the addresses is zero"
        );
        BUSD = _BUSD;
        distributor = _distributor;
        pulse = _pulse;
        router = _router;
        setNonBUSDCurrencies(
            _CAKELP,
            _BTC,
            _ETH,
            _ZOINKS,
            _SNACKS,
            _BTCSNACKS,
            _ETHSNACKS
        );
        IERC20(BUSD).approve(router, type(uint256).max);
    }
    
    function initialize(
        address _bdmWallet,
        address _crmWallet,
        address _devManagerWallet,
        address _marketingManagerWallet,
        address _devWallet,
        address _marketingFundWallet,
        address _reservesWallet,
        address _situationalFundWallet,
        address _seniorageWallet
    )
        external
        onlyOwner
        initializer
    {
        require(
            _bdmWallet != address(0) &&
            _crmWallet != address(0) &&
            _devManagerWallet != address(0) &&
            _marketingManagerWallet != address(0) &&
            _devWallet != address(0) &&
            _marketingFundWallet != address(0) &&
            _reservesWallet != address(0) &&
            _situationalFundWallet != address(0) &&
            _seniorageWallet != address(0),
            "Seniorage: one of the addresses is zero"
        );
        bdmWallet = _bdmWallet;
        crmWallet = _crmWallet;
        devManagerWallet = _devManagerWallet;
        marketingManagerWallet = _marketingManagerWallet;
        devWallet = _devWallet;
        marketingFundWallet = _marketingFundWallet;
        reservesWallet = _reservesWallet;
        situationalFundWallet = _situationalFundWallet;
        seniorageWallet = _seniorageWallet;
    }
    
    /// @notice distributes non BUSD currencies on the contract
    function distributeNonBUSDCurrencies() external onlyDistributor {
        for (uint256 i = 0; i < nonBUSDcurrencies.length(); i++) {
            address currency = nonBUSDcurrencies.at(i);
            uint256 balance = IERC20(currency).balanceOf(address(this));
            if (balance != 0) {
                IERC20(currency).safeTransfer(bdmWallet, balance * FIVE_PERCENT / BASE_PERCENT);
                IERC20(currency).safeTransfer(crmWallet, balance * FIVE_PERCENT / BASE_PERCENT);
                IERC20(currency).safeTransfer(devManagerWallet, balance * FIVE_PERCENT / BASE_PERCENT);
                IERC20(currency).safeTransfer(marketingManagerWallet, balance * FIVE_PERCENT / BASE_PERCENT);
                IERC20(currency).safeTransfer(devWallet, balance * TEN_PERCENT / BASE_PERCENT);
                IERC20(currency).safeTransfer(marketingFundWallet, balance * TWENTY_PERCENT / BASE_PERCENT);
                IERC20(currency).safeTransfer(reservesWallet, balance * THIRTY_FIVE_PERCENT / BASE_PERCENT);
                IERC20(currency).safeTransfer(situationalFundWallet, balance * FIFTEEN_PERCENT / BASE_PERCENT);
                if (IERC20(currency).balanceOf(address(this)) != 0) {
                    uint256 remainingBalance = IERC20(currency).balanceOf(address(this));
                    IERC20(currency).safeTransfer(devWallet, remainingBalance);
                }
            } else {
                continue;
            }
        }
    }
    
    /// @notice distributes BUSD on the contract
    function distributeBUSD() external onlyDistributor {
        uint256 balance = IERC20(BUSD).balanceOf(address(this));
        require(
            balance > 0,
            "Seniorage: nothing to distribute"
        );
        // swap of 7.5% BUSD of the contract balance on BTC
        uint256 amountToSwapOnBTCorETH = balance * SEVEN_AND_A_HALF_PERCENT / BASE_PERCENT;
        address[] memory path = new address[](2);
        path[0] = BUSD;
        path[1] = BTC;
        uint256[] memory amounts = IRouter(router).swapExactTokensForTokens(
            amountToSwapOnBTCorETH,
            amountToSwapOnBTCorETH * SLIPPAGE_PERCENT / BASE_PERCENT,
            path,
            address(this),
            block.timestamp + 15
        );
        // buying BTCSNACKS for received BTC
        uint256 balanceBefore = IERC20(BTCSNACKS).balanceOf(address(this));
        ISnacks(BTCSNACKS).buyTotal(amounts[1]);
        uint256 difference = IERC20(BTCSNACKS).balanceOf(address(this)) - balanceBefore;
        // transfer BTCSNACKS to seniorage wallet and pulse
        IERC20(BTCSNACKS).safeTransfer(seniorageWallet, difference * SENIORAGE_PERCENT / BASE_PERCENT);
        IERC20(BTCSNACKS).safeTransfer(pulse, difference * PULSE_PERCENT / BASE_PERCENT);
        // swap of 7.5% BUSD of the contract balance on ETH
        path[1] = ETH;
        amounts = IRouter(router).swapExactTokensForTokens(
            amountToSwapOnBTCorETH,
            amountToSwapOnBTCorETH * SLIPPAGE_PERCENT / BASE_PERCENT,
            path,
            address(this),
            block.timestamp + 15
        );
        // buying ETHSNACKS for received ETH
        balanceBefore = IERC20(ETHSNACKS).balanceOf(address(this));
        ISnacks(ETHSNACKS).buyTotal(amounts[1]);
        difference = IERC20(ETHSNACKS).balanceOf(address(this)) - balanceBefore;
        // transfer ETHSNACKS to seniorage wallet and pulse
        IERC20(ETHSNACKS).safeTransfer(seniorageWallet, difference * SENIORAGE_PERCENT / BASE_PERCENT);
        IERC20(ETHSNACKS).safeTransfer(pulse, difference * PULSE_PERCENT / BASE_PERCENT);
        // swap of 20% BUSD of the contract balance on ZOINKS
        uint256 amountToSwapOnZoinks = balance * TWENTY_PERCENT / BASE_PERCENT;
        path[1] = ZOINKS;
        amounts = IRouter(router).swapExactTokensForTokens(
            amountToSwapOnZoinks,
            amountToSwapOnZoinks * SLIPPAGE_PERCENT / BASE_PERCENT,
            path,
            address(this),
            block.timestamp + 15
        );
        // buying SNACKS for received ZOINKS
        balanceBefore = IERC20(SNACKS).balanceOf(address(this));
        ISnacks(SNACKS).buyTotal(amounts[1]);
        difference = IERC20(SNACKS).balanceOf(address(this)) - balanceBefore;
        // transfer SNACKS to seniorage wallet and pulse
        IERC20(SNACKS).safeTransfer(seniorageWallet, difference * SEVENTY_FIVE_PERCENT / BASE_PERCENT);
        IERC20(SNACKS).safeTransfer(pulse, difference * TWENTY_FIVE_PERCENT / BASE_PERCENT);
        // swap of 15% BUSD of the contract balance on ZOINKS
        amountToSwapOnZoinks = balance * FIFTEEN_PERCENT / BASE_PERCENT;
        amounts = IRouter(router).swapExactTokensForTokens(
            amountToSwapOnZoinks,
            amountToSwapOnZoinks * SLIPPAGE_PERCENT / BASE_PERCENT,
            path,
            address(this),
            block.timestamp + 15
        );
        // liquidity addition on 30% BUSD of the contract balance
        (, , uint256 liquidity) = IRouter(router).addLiquidity(
            BUSD,
            ZOINKS,
            amounts[1],
            amounts[1],
            amounts[1] * SLIPPAGE_PERCENT / BASE_PERCENT,
            amounts[1] * SLIPPAGE_PERCENT / BASE_PERCENT,
            address(this),
            block.timestamp + 15
        );
        // transfer CAKELP to pulse
        IERC20(CAKELP).safeTransfer(pulse, liquidity);
    }
    
    /// @notice sets distributor
    function setDistributor(address _distributor) external onlyOwner {
        require(
            _distributor != address(0),
            "Seniorage: attempt to assign a zero address"
        );
        distributor = _distributor;
    }
    
    /// @notice sets pulse
    function setPulse(address _pulse) external onlyOwner {
        require(
            _pulse != address(0),
            "Seniorage: attempt to assign a zero address"
        );
        pulse = _pulse;
    }
    
    /// @notice sets non BUSD currencies
    function setNonBUSDCurrencies(
        address _CAKELP,
        address _BTC,
        address _ETH,
        address _ZOINKS,
        address _SNACKS,
        address _BTCSNACKS,
        address _ETHSNACKS
    )
        public
        onlyOwner
    {
        require(
            _CAKELP != address(0) &&
            _BTC != address(0) &&
            _ETH != address(0) &&
            _ZOINKS != address(0) &&
            _SNACKS != address(0) &&
            _BTCSNACKS != address(0) &&
            _ETHSNACKS != address(0),
            "Seniorage: one of the addresses is zero"
        );
        for (uint256 i = 0; i < nonBUSDcurrencies.length(); i++) {
            address currency = nonBUSDcurrencies.at(i);
            nonBUSDcurrencies.remove(currency);
        }
        CAKELP = _CAKELP;
        BTC = _BTC;
        ETH = _ETH;
        ZOINKS = _ZOINKS;
        SNACKS = _SNACKS;
        BTCSNACKS = _BTCSNACKS;
        ETHSNACKS = _ETHSNACKS;
        nonBUSDcurrencies.add(_BTC);
        nonBUSDcurrencies.add(_ETH);
        nonBUSDcurrencies.add(_ZOINKS);
        nonBUSDcurrencies.add(_SNACKS);
        nonBUSDcurrencies.add(_BTCSNACKS);
        nonBUSDcurrencies.add(_ETHSNACKS);
        IERC20(ZOINKS).approve(router, type(uint256).max);
        IERC20(ZOINKS).approve(SNACKS, type(uint256).max);
        IERC20(BTC).approve(BTCSNACKS, type(uint256).max);
        IERC20(ETH).approve(ETHSNACKS, type(uint256).max);
    }
